import React from 'react';
import './Home.css';

const About = () => {
  return (
    <div className="About">
      <div className="TwoColumnGrid">
        <div className="Section">
          <h1><em>About Us</em></h1>
          <p>Mighty Muf’ler Inc.Mighty Muf’ler has been the go to Muffler shop in Phoenix Arizona since 1979. From custom exhausts to catalytic converter replacements Mighty Muf’ler can handle any exhaust system need. It has been locally owned and operated since 1979. </p>
        </div>          
        <div className="ImgWrapper">
          <img alt="Image of mufflers" src="https://images.squarespace-cdn.com/content/v1/5e9fa98348d28b20b3f39b36/1587803065032-7X0GNQ25GDPSESU7WDN8/ke17ZwdGBToddI8pDm48kPoswlzjSVMM-SxOp7CV59BZw-zPPgdn4jUwVcJE1ZvWQUxwkmyExglNqGp0IvTJZamWLI2zvYWH8K3-s_4yszcp2ryTI0HqTOaaUohrI8PIeQMKeWYgwh6Mn73n2eZmZLHHpcPIxgL2SArp_rN2M_AKMshLAGzx4R3EDFOm1kBS/duals+pic.jpg?format=1500w"></img>
        </div>
      </div>
    </div>
  );
}

export default About;
